pragma solidity ^0.5.0;

import "./Roles.sol";

contract ConfigRole {
    using Roles for Roles.Role;

    event ConfigAdded(address indexed account);
    event ConfigRemoved(address indexed account);

    Roles.Role private _Configs;

    constructor () internal {
        _addConfig(msg.sender);
    }

    modifier onlyConfig() {
        require(isConfig(msg.sender), "ConfigRole: caller does not have the Config role");
        _;
    }

    function isConfig(address account) public view returns (bool) {
        return _Configs.has(account);
    }

    function addConfig(address account) public onlyConfig {
        _addConfig(account);
    }

    function renounceConfig() public {
        _removeConfig(msg.sender);
    }

    function _addConfig(address account) internal {
        _Configs.add(account);
        emit ConfigAdded(account);
    }

    function _removeConfig(address account) internal {
        _Configs.remove(account);
        emit ConfigRemoved(account);
    }
}
